import React, { Component } from 'react';
import SelectionList from "./SelectionList";

class SelectionPage extends Component {
    constructor() {
        this.movies = {
            upcoming: {
                apiCall: "upcoming",
                header:
                "Stratégie"
            },
            topRated: {
                apiCall: "top_rated",
                header: "Spécifications"
            },
            action: {
                apiCall: 28,
                header: "Ux/Ui"
            },
            adventure: {
                apiCall: 12,
                header: "Contenus"
            },
            animation: {
                apiCall: 16,
                header: "Front-end"
            },
            comedy: {
                apiCall: 35,
                header: "Architecture"
            },
            crime: {
                apiCall: 80,
                header: "Back-end"
            },
            mystery: {
                apiCall: 878,
                header: "Hebergement"
            }
        };
    }

    async componentWillMount() {
        await this.loadCsv()
        await this.timeout(100)
    }



    render() {
        return (
            <div>
                {Object.keys(this.movies).map((item, i) => (
                    <div key={i}>
                        <SelectionList heading={this.movies[item].header} apiCall={this.movies[item].apiCall} />
                    </div>
            ))}
            </div>
        );
    }
}

export default SelectionPage;
